vehicles = {"car1": "Toyota", "car2": "BMW", "car3": "Tesla", "car4": "Ford", "car5": "Honda"}
index = input("Введите индекс транспортного средства: ")
try:
    idx = int(index)
    if 1 <= idx <= len(vehicles):
        car = list(vehicles.keys())[idx - 1]
        print(f"Автомобиль: {vehicles[car]}")
    else:
        print("Неверный индекс.")
except ValueError:
    print("Введите корректное целое число.")
